import React, { useState } from 'react';
import { Card, CardHeader, CardContent } from './card';
import { Button } from './button';
import { Input } from './ui/input';
import { Textarea } from './textarea';
import { Plus, Loader2, ChevronDown } from 'lucide-react';
import { validatePropertyFormData } from '../utils/errors';

// Security Utilities
const sanitizeInput = (input) => {
    if (typeof input !== 'string') return input;
    return input
        .replace(/</g, '&lt;')
        .replace(/>/g, '&gt;')
        .replace(/"/g, '&quot;')
        .replace(/'/g, '&#039;')
        .replace(/javascript:/gi, '')
        .replace(/on\w+=/gi, '')
        .replace(/data:/gi, '')
        .trim();
};

const validateSecurity = (value, type) => {
    if (typeof value !== 'string') return value;

    switch (type) {
        case 'id':
            return value.replace(/[^a-zA-Z0-9-]/g, '');
        case 'title':
            return value.replace(/<\/?[^>]+(>|$)/g, '');
        case 'description':
            return value.replace(/<\/?[^>]+(>|$)/g, '');
        case 'price':
            return value.replace(/[^0-9.]/g, '');
        default:
            return sanitizeInput(value);
    }
};

const ISRAELI_CITIES = [
    'Jerusalem', 'Tel Aviv', 'Haifa', 'Rishon LeZion',
    'Petah Tikva', 'Ashdod', 'Netanya', 'Beer Sheva',
    'Holon', 'Bnei Brak'
];

const PropertyForm = ({ onSubmit, contract, isProcessing }) => {
    const [showCities, setShowCities] = useState(false);
    const [formErrors, setFormErrors] = useState({});
    const [property, setProperty] = useState({
        id: '',
        title: '',
        description: '',
        location: '',
        price: ''
    });

    const validateFormSecurity = (propertyData) => {
        const errors = {};
        const xssPatterns = [
            /<script\b[^<]*(?:(?!<\/script>)<[^<]*)*<\/script>/gi,
            /javascript:/gi,
            /on\w+=/gi,
            /data:/gi,
            /alert\(/gi,
            /eval\(/gi,
            /Function\(/gi
        ];

        for (const [field, value] of Object.entries(propertyData)) {
            if (typeof value === 'string') {
                // Check for XSS patterns
                for (const pattern of xssPatterns) {
                    if (pattern.test(value)) {
                        errors[field] = 'Invalid characters or patterns detected';
                        break;
                    }
                }

                // Field-specific validation
                switch (field) {
                    case 'id':
                        if (!/^[a-zA-Z0-9-]+$/.test(value)) {
                            errors[field] = 'ID can only contain letters, numbers, and hyphens';
                        }
                        break;
                    case 'price':
                        if (!/^\d*\.?\d*$/.test(value)) {
                            errors[field] = 'Price can only contain numbers and decimal point';
                        }
                        break;
                }
            }
        }

        return errors;
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;

        // Security validation and sanitization
        const sanitizedValue = validateSecurity(value, name);

        if (name === 'description') {
            const lines = sanitizedValue.split('\n');
            if (lines.length <= 4) {
                setProperty(prev => ({
                    ...prev,
                    [name]: sanitizedValue
                }));
            }
            return;
        }

        if (name === 'price' && sanitizedValue) {
            const numValue = parseFloat(sanitizedValue);
            if (numValue < 0 || numValue > 1000000) {
                return;
            }
        }

        setProperty(prev => ({
            ...prev,
            [name]: sanitizedValue
        }));

        if (formErrors[name]) {
            setFormErrors(prev => ({
                ...prev,
                [name]: ''
            }));
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        console.log('Form submission initiated');

        // Security validation
        const securityErrors = validateFormSecurity(property);
        if (Object.keys(securityErrors).length > 0) {
            console.log('Security validation failed:', securityErrors);
            setFormErrors(securityErrors);
            return;
        }

        // Form validation
        const validationErrors = validatePropertyFormData(property);
        if (Object.keys(validationErrors).length > 0) {
            console.log('Form validation failed:', validationErrors);
            setFormErrors(validationErrors);
            return;
        }

        try {
            // Final sanitization before submission
            const sanitizedProperty = {
                id: validateSecurity(property.id, 'id'),
                title: validateSecurity(property.title, 'title'),
                description: validateSecurity(property.description, 'description'),
                location: property.location,
                price: validateSecurity(property.price, 'price')
            };

            console.log('Submitting sanitized property:', sanitizedProperty);
            await onSubmit(sanitizedProperty);

            // Clear form on success
            setProperty({
                id: '',
                title: '',
                description: '',
                location: '',
                price: ''
            });
            setFormErrors({});
        } catch (error) {
            console.error('Submission error:', error);
            setFormErrors({ 
                submit: sanitizeInput(error.message) || 'An error occurred during submission' 
            });
        }
    };

    const selectCity = (city) => {
        if (ISRAELI_CITIES.includes(city)) {
            setProperty(prev => ({
                ...prev,
                location: city
            }));
            setShowCities(false);
            if (formErrors.location) {
                setFormErrors(prev => ({
                    ...prev,
                    location: ''
                }));
            }
        }
    };

    return (
        <Card>
            <CardHeader>
                <h2 className="text-xl font-semibold flex items-center gap-2">
                    <Plus className="h-5 w-5" />
                    List New Property
                </h2>
            </CardHeader>
            <CardContent>
                <form onSubmit={handleSubmit} className="space-y-4">
                    <div>
                        <Input
                            name="id"
                            placeholder="Property ID (letters, numbers, hyphens only)"
                            value={property.id}
                            onChange={handleInputChange}
                            required
                            disabled={isProcessing}
                            className={formErrors.id ? 'border-red-500' : ''}
                            maxLength={50}
                        />
                        {formErrors.id && (
                            <p className="text-red-500 text-sm mt-1">{formErrors.id}</p>
                        )}
                    </div>

                    <div>
                        <Input
                            name="title"
                            placeholder="Property Title (single line)"
                            value={property.title}
                            onChange={handleInputChange}
                            required
                            disabled={isProcessing}
                            className={formErrors.title ? 'border-red-500' : ''}
                            maxLength={100}
                        />
                        {formErrors.title && (
                            <p className="text-red-500 text-sm mt-1">{formErrors.title}</p>
                        )}
                    </div>

                    <div>
                        <Textarea
                            name="description"
                            placeholder="Property Description (max 4 lines)"
                            value={property.description}
                            onChange={handleInputChange}
                            required
                            disabled={isProcessing}
                            className={`min-h-[100px] ${formErrors.description ? 'border-red-500' : ''}`}
                            rows={4}
                            maxLength={500}
                        />
                        {formErrors.description && (
                            <p className="text-red-500 text-sm mt-1">{formErrors.description}</p>
                        )}
                    </div>

                    <div className="relative">
                        <div
                            className="relative cursor-pointer"
                            onClick={() => !isProcessing && setShowCities(!showCities)}
                        >
                            <Input
                                name="location"
                                placeholder="Select Location"
                                value={property.location}
                                readOnly
                                required
                                disabled={isProcessing}
                                className={formErrors.location ? 'border-red-500' : ''}
                            />
                            <ChevronDown className="absolute right-3 top-3 h-4 w-4" />
                        </div>
                        {showCities && (
                            <div className="absolute z-10 w-full mt-1 bg-white border rounded-md shadow-lg max-h-60 overflow-auto">
                                {ISRAELI_CITIES.map((city) => (
                                    <div
                                        key={city}
                                        className="px-4 py-2 hover:bg-gray-100 cursor-pointer"
                                        onClick={() => selectCity(city)}
                                    >
                                        {city}
                                    </div>
                                ))}
                            </div>
                        )}
                        {formErrors.location && (
                            <p className="text-red-500 text-sm mt-1">{formErrors.location}</p>
                        )}
                    </div>

                    <div>
                        <Input
                            name="price"
                            type="number"
                            step="0.01"
                            min="0"
                            max="1000000"
                            placeholder="Price (ETH)"
                            value={property.price}
                            onChange={handleInputChange}
                            required
                            disabled={isProcessing}
                            className={formErrors.price ? 'border-red-500' : ''}
                        />
                        {formErrors.price && (
                            <p className="text-red-500 text-sm mt-1">{formErrors.price}</p>
                        )}
                    </div>

                    {formErrors.submit && (
                        <div className="bg-red-50 border border-red-200 text-red-700 px-4 py-3 rounded">
                            {formErrors.submit}
                        </div>
                    )}

                    <Button 
                        type="submit" 
                        disabled={isProcessing || !contract}
                        className="w-full"
                    >
                        {isProcessing ? (
                            <div className="flex items-center justify-center gap-2">
                                <Loader2 className="h-4 w-4 animate-spin" />
                                Processing...
                            </div>
                        ) : 'List Property'}
                    </Button>
                </form>
            </CardContent>
        </Card>
    );
};

export default PropertyForm;
